import {Link} from 'react-router-dom';
import {Stack,Image,Grid,GridItem,Box} from '@chakra-ui/react';

const link = [
    {
        to:"/",
        title:"Home"
    },
    {
        to:"/Meal-Deals",
        title:"Meal Deals"
    },
    {
        to:"/KindMoments",
        title:"KindMoments"
    },
    {
        to:"/Hot-Picks",
        title:"Hot Picks"
    },
    {
        to:"/Recipes",
        title:"Recipes"
    },
    {
        to:"/Directory",
        title:"Directory"
    },
    {
        to:"/Articles",
        title:"Articles"
    },
    {
        to:"/Help",
        title:"Help"
    }
]
function Navbar(){
    return(
        <Stack>
            <Box display="flex" flexDirection="row" border="1px solid red" height="90px" justifyContext="space-around">
                <Box pl='5'>
                    <Link to='/'>
                        <Image src="https://www.kindmeal.my/images/logo-kindmeal.png"/>
                    </Link>
                </Box>
                <Box display="flex">
                    <Box>
                        <Link to='/'>
                            <Image src="https://www.kindmeal.my/images/follow_blog_grey.png"/>
                        </Link>
                    </Box>
                    <Box>
                        <Link to='/'>
                            <Image src="https://www.kindmeal.my/images/follow_facebook_grey.png"/>
                        </Link>
                    </Box>
                    <Box>
                        <Link to='/'>
                            <Image src="https://www.kindmeal.my/images/follow_twitter_grey.png"/>
                        </Link>
                    </Box>
                </Box>
                <Box display="flex">
                    Text
                </Box>
            </Box>
            <Box></Box>
        </Stack>
    )
}

export default Navbar;
